config.viewfilename.help.content=<p>\u0412\u044a\u0432\u0435\u0434\u0435\u0442\u0435 \u0431\u0430\u0437\u043e\u0432\u043e\u0442\u043e \u0438\u043c\u0435 (\u0432\u043a\u043b\u044e\u0447\u0438\u0442\u0435\u043b\u043d\u043e \u0440\u0430\u0437\u0448\u0438\u0440\u0435\u043d\u0438\u0435\u0442\u043e) \u043d\u0430 \u0440\u0430\u0437\u0433\u043b\u0435\u0436\u0434\u0430\u043d\u0438\u044f \u0444\u0430\u0439\u043b.  \u041d\u0430\u043f\u0440\u0438\u043c\u0435\u0440, <\u043a\u043e\u0434>myViewFile.html</\u043a\u043e\u0434>.</p><p>\u0422\u043e\u0437\u0438 \u0444\u0430\u0439\u043b \u0432\u043a\u043b\u044e\u0447\u0432\u0430 \u0441\u044a\u0434\u044a\u0440\u0436\u0430\u043d\u0438\u0435\u0442\u043e, \u043a\u043e\u0435\u0442\u043e \u0438\u0441\u043a\u0430\u0442\u0435 \u0434\u0430 \u043f\u043e\u043a\u0430\u0436\u0435 \u043f\u043e\u0440\u0442\u043b\u0435\u0442\u044a\u0442 \u0438 \u0442\u043e \u0442\u0440\u044f\u0431\u0432\u0430 \u0434\u0430 \u0441\u044a\u0449\u0435\u0441\u0442\u0432\u0443\u0432\u0430.  \u0422\u043e\u0437\u0438 \u0444\u0430\u0439\u043b \u0442\u0440\u044f\u0431\u0432\u0430 \u0434\u0430 \u0441\u044a\u0449\u0435\u0441\u0442\u0432\u0443\u0432\u0430 \u043d\u0430 \u0432\u0441\u0435\u043a\u0438 \u0441\u044a\u0440\u0432\u044a\u0440 \u043d\u0430 \u043f\u043e\u0440\u0442\u043b\u0435\u0442\u0438 \u0432 \u0442\u043e\u0437\u0438 \u043a\u043b\u044a\u0441\u0442\u0435\u0440, \u0432 \u043f\u0430\u043f\u043a\u0430\u0442\u0430 <\u043a\u043e\u0434>html</\u043a\u043e\u0434> \u043d\u0430 \u043f\u0430\u043a\u0435\u0442\u0430 \u043f\u043e\u0440\u0442\u043b\u0435\u0442\u043d\u0438 \u0440\u0435\u0441\u0443\u0440\u0441\u0438 \u0438\u043b\u0438 \u0432 \u043f\u043e\u0434\u043f\u0430\u043f\u043a\u0430 \u043d\u0430 \u0441\u044a\u0449\u0430\u0442\u0430.  (\u0410\u043b\u0442\u0435\u0440\u043d\u0430\u0442\u0438\u0432\u043d\u043e, \u0444\u0430\u0439\u043b\u044a\u0442 \u043c\u043e\u0436\u0435 \u0434\u0430 \u0441\u044a\u0449\u0435\u0441\u0442\u0432\u0443\u0432\u0430 \u0432 \u043f\u0430\u043f\u043a\u0430\u0442\u0430 <\u043a\u043e\u0434>html</\u043a\u043e\u0434> \u0438\u043b\u0438 \u0432 \u043f\u043e\u0434\u043f\u0430\u043f\u043a\u0430 \u043d\u0430 \u0441\u044a\u0449\u0430\u0442\u0430 \u0432 \u0441\u0430\u043c\u0438\u044f \u043f\u043e\u0440\u0442\u043b\u0435\u0442 WAR.)  \u0410\u043a\u043e \u0438\u0437\u043f\u043e\u043b\u0437\u0432\u0430\u0442\u0435 \u043f\u043e\u0434\u043f\u0430\u043f\u043a\u0430, \u0438\u043c\u0435\u0442\u043e \u043d\u0430 \u0440\u0430\u0437\u0433\u043b\u0435\u0436\u0434\u0430\u043d\u0438\u044f \u0444\u0430\u0439\u043b \u0442\u0440\u044f\u0431\u0432\u0430 \u0434\u0430 \u0432\u043a\u043b\u044e\u0447\u0432\u0430 \u043f\u044a\u0442\u044f \u043d\u0430 \u0442\u0430\u0437\u0438 \u043f\u043e\u0434\u043f\u0430\u043f\u043a\u0430.  \u041d\u0430\u043f\u0440\u0438\u043c\u0435\u0440, <\u043a\u043e\u0434>myFiles/myViewFile.html</\u043a\u043e\u0434>.</p><p>\u0421\u044a\u0434\u044a\u0440\u0436\u0430\u043d\u0438\u0435\u0442\u043e \u043d\u0430 \u0444\u0430\u0439\u043b\u0430 \u0442\u0440\u044f\u0431\u0432\u0430 \u0434\u0430 \u0431\u044a\u0434\u0435 \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u0435\u043d\u043e \u0437\u0430 \u043b\u043e\u043a\u0430\u043b\u043d\u0430\u0442\u0430 \u0431\u0430\u0437\u0430.  \u0410\u043a\u043e \u0438\u043c\u0430\u0442\u0435 \u043f\u0440\u0435\u0432\u0435\u0434\u0435\u043d\u043e \u0441\u044a\u0434\u044a\u0440\u0436\u0430\u043d\u0438\u0435, \u043f\u0440\u0435\u0432\u0435\u0434\u0435\u043d\u0438\u0442\u0435 \u0444\u0430\u0439\u043b\u043e\u0432\u0435 \u0437\u0430 \u0440\u0430\u0437\u0433\u043b\u0435\u0436\u0434\u0430\u043d\u0435 \u0442\u0440\u044f\u0431\u0432\u0430 \u0434\u0430 \u0441\u044a\u043f\u044a\u0442\u0441\u0442\u0432\u0430\u0442 \u043e\u0441\u043d\u043e\u0432\u043d\u0438\u044f \u0444\u0430\u0439\u043b \u0437\u0430 \u0440\u0430\u0437\u0433\u043b\u0435\u0436\u0434\u0430\u043d\u0435 \u043d\u0430 \u0441\u044a\u0449\u043e\u0442\u043e \u043c\u044f\u0441\u0442\u043e \u0438 \u0434\u0430 \u0431\u044a\u0434\u0430\u0442 \u0441\u044a\u043e\u0442\u0432\